import React from 'react';
import logo from './169367.png';

class WeatherCard extends React.Component {




	render() {
		return(
			<div>
				<h1>Name of City</h1>
				<h2>Temperature</h2>
				<img src={logo} alt='sun' style={{height: '100px'}}/>
				<h3>Type of Weather</h3>
				<div class='container' style={{display: 'flex', alignItems: 'center'}}>
					<h5 style={{display: 'inline', margin: '0 10px'}}>High</h5>
					<h5 style={{display: 'inline', margin: '0 10px'}}>Low</h5>
				</div>
			</div>

		);
	}
}

export default WeatherCard;

